import { Homepage } from '@/payload-types'

type ServiceBlock = Extract<NonNullable<Homepage['blocks']>[number], { blockType: 'services' }>

type ServiceIcons = ServiceBlock['services'][number]['icon']

interface ServiceIconMapperProps {
  icon: ServiceIcons
}

const ServiceIconMapper: React.FC<ServiceIconMapperProps> = ({ icon }) => {
  switch (icon) {
    case 'family':
      return <FamilyIcon />
    case 'plane':
      return <PlaneIcon />
    case 'calendar':
      return <CalendarIcon />
    case 'notepad':
      return <NotepadIcon />
    case 'office':
      return <OfficeIcon />
    case 'contact':
      return <ContactIcon />
    default:
      return null
  }
}

export default ServiceIconMapper

